import './App.css'
import Card from './components/Card.jsx'
import Cards from './components/Cards.jsx'
import SearchBar from './components/SearchBar.jsx'
import characters, { Rick } from './data.js'
import {Container, ContCartas} from './components/styled-components.jsx'

function App () {
  return (
    <Container className='App' style={{ padding: '25px'}}>
      
      <div>
        <div>
        <SearchBar
          onSearch={(characterID) => window.alert(characterID)}
          //navigate(/home)
        />
        </div>
        <hr/>
      </div>
      <div>

        <Card
        
          name={Rick.name}
          species={Rick.species}
          gender={Rick.gender}
          image={Rick.image}
          onClose={() => window.alert('Emulamos que se cierra la card')}
          
        />
        <hr/>
      </div>
      <ContCartas>
      
      <div>
        <Cards
          characters={characters}
        />
      </div>
     
      </ContCartas>
    </Container>
  )
}

export default App
